var title_f37_43_38583="Acute EAA CT";
var content_f37_43_38583=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F59749%7EPULM%2F71870%7EPULM%2F52041&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F59749%7EPULM%2F71870%7EPULM%2F52041&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Acute phase of hypersenstivity pneumonitis (extrinsic allergic alveolitis)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 343px; height: 255px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    CT scan shows ground glass opacification of the lungs during the acute phase of hypersensitivity pneumonitis (extrinsic allergic alveolitis). Several secondary pulmonary lobules are spared and appear as darker areas in both lower lobes.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Subacute hypersensitivity pneumonitis (extrinsic allergic alveolitis)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 363px; height: 213px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Subacute hypersensitivity pneumonitis (extrinsic allergic alveolitis) with multiple so-called acinar nodules permeating the entire lung.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Chronic hypersensitivity pneumonitis (extrinsic allergic alveolitis)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 357px; height: 228px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Chronic phase of hypersensitivity pneumonitis (extrinsic allergic alveolitis) due to birds. Focal honeycombing is present in the right upper lobe and mild bilateral cylindrical bronchiectasis is visible.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
