" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Piebaldism",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A congenital depigmented patch with white hair is present on the scalp and forehead of this man with piebaldism. The patient also had depigmented patches on the trunk and extremities. Multiple family members had similar lesions.",
"    <div class=\"footnotes\">",
"    </div>",
