"   <div class=\"block mop drugH1Div\" id=\"F213073\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Blood pressure, blood glucose, electrolytes",
"    </p>",
"    <p style=\"text-indent:0em;margin-top:2em;\">",
"     Following prolonged use: Bone mass density, growth in children, signs and symptoms of infection, cataract formation, intraocular pressure (use &gt;6 weeks)",
"    </p>",
"   </div>",
