var title_f37_43_38586="Anaphylaxis mechanisms and triggers";
var content_f37_43_38586=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F82830&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F82830&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 652px\">",
"   <div class=\"ttl\">",
"    Anaphylaxis mechanisms and triggers",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 632px; height: 791px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Anaphylaxis mechanisms and triggers: Anaphylaxis typically occurs through an IgE-dependent immunologic mechanism, most commonly triggered by foods, stinging insect venoms, or medications.",
"    <div class=\"footnotes\">",
"     * Trigger anaphylaxis by more than one mechanism.",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     NSAIDs: non-steroidal anti-inflammatory drugs.",
"     <br/>",
"     &Delta; HMW: high molecular weight.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Simons FER, Ardusso LRF, Beatrice Bilo M, et al. World Allergy Organization guidelines for the assessment and management of anaphylaxis. WAO Journal 2011; 4:13. Copyright &copy; 2011 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
