var title_f37_43_38587="Pulmonary index score";
var content_f37_43_38587=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F53797&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F53797&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Pulmonary index score",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Score",
"      </td>",
"      <td class=\"subtitle1\">",
"       Respiratory rate*",
"      </td>",
"      <td class=\"subtitle1\">",
"       Wheezing&bull;",
"      </td>",
"      <td class=\"subtitle1\">",
"       Inspiratory/ expiratory ratio",
"      </td>",
"      <td class=\"subtitle1\">",
"       Accessory muscle use",
"      </td>",
"      <td class=\"subtitle1\">",
"       Oxygen saturation",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       0",
"      </td>",
"      <td>",
"       &le;30",
"      </td>",
"      <td>",
"       None",
"      </td>",
"      <td>",
"       2:1",
"      </td>",
"      <td>",
"       None",
"      </td>",
"      <td>",
"       99-100",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1",
"      </td>",
"      <td>",
"       31-45",
"      </td>",
"      <td>",
"       End expiration",
"      </td>",
"      <td>",
"       1:1",
"      </td>",
"      <td>",
"       +",
"      </td>",
"      <td>",
"       96-98",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2",
"      </td>",
"      <td>",
"       46-60",
"      </td>",
"      <td>",
"       Entire expiration",
"      </td>",
"      <td>",
"       1:2",
"      </td>",
"      <td>",
"       ++",
"      </td>",
"      <td>",
"       93-95",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       3",
"      </td>",
"      <td>",
"       &gt;60",
"      </td>",
"      <td>",
"       Inspiration and expiration",
"      </td>",
"      <td>",
"       1:3",
"      </td>",
"      <td>",
"       +++",
"      </td>",
"      <td>",
"       &lt;93",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * For patients &ge;age 6: through 20, score 0; 21-35, score 1; 36-50, score 2; &gt;50, score 3. The total score ranges from 0 to 15. In general, a score of less than 7 indicates a mild attack, a score of 7 to 11 indicates a moderately severe attack, and a score of 12 or greater indicates a severe attack. However, the Pulmonary Index Score may underestimate the degree of illness in an older child.",
"     <br>",
"      &bull; If no wheezing due to minimal air entry, score 3.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Richard Scarfone, MD, FAAP.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
